import React, { Component } from 'react';

export class App extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                <div className="col col-sm-12">Navbar</div>
                </div>
                <div className="row">
                    <div className="col -6">Titulo</div>
                    <div className="col -6">Imagen</div>

                </div>
                <div className="row">
                    <div className="col -6">Contenido</div>
                    <div className="col -6">Imagen</div>
                </div>
                <div className="row">
                    <div className="col -6">Video1</div>
                    <div className="col -6">Video2</div>
                    <div className="col -6">Video3</div>
                    <div className="col -6">Video4</div>
                </div>
                <div className="row">Contactanos</div>
                <div className="row">Footer</div>
            </div>
        );
    }
}

export default App;
